import React, { useState } from 'react';
import amadeusService from '../services/amadeusService';
import '../styles/FlightSearch.css';

const FlightSearch = () => {
  const [searchParams, setSearchParams] = useState({
    originLocationCode: '',
    destinationLocationCode: '',
    departureDate: '',
    returnDate: '',
    adults: 1
  });
  const [flights, setFlights] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setSearchParams(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSearch = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError(null);

    try {
      const results = await amadeusService.searchFlights(
        searchParams.originLocationCode,
        searchParams.destinationLocationCode,
        searchParams.departureDate,
        searchParams.returnDate,
        searchParams.adults
      );
      setFlights(results.data || []);
    } catch (err) {
      setError('Error searching for flights. Please try again.');
      console.error(err);
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="flight-search-container">
      <h2>Search Flights</h2>
      <form onSubmit={handleSearch} className="search-form">
        <div className="form-group">
          <label>From (Airport Code):</label>
          <input
            type="text"
            name="originLocationCode"
            value={searchParams.originLocationCode}
            onChange={handleInputChange}
            placeholder="e.g., JFK"
            required
          />
        </div>

        <div className="form-group">
          <label>To (Airport Code):</label>
          <input
            type="text"
            name="destinationLocationCode"
            value={searchParams.destinationLocationCode}
            onChange={handleInputChange}
            placeholder="e.g., LAX"
            required
          />
        </div>

        <div className="form-group">
          <label>Departure Date:</label>
          <input
            type="date"
            name="departureDate"
            value={searchParams.departureDate}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Return Date:</label>
          <input
            type="date"
            name="returnDate"
            value={searchParams.returnDate}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Number of Adults:</label>
          <input
            type="number"
            name="adults"
            value={searchParams.adults}
            onChange={handleInputChange}
            min="1"
            max="9"
            required
          />
        </div>

        <button type="submit" disabled={loading}>
          {loading ? 'Searching...' : 'Search Flights'}
        </button>
      </form>

      {error && <div className="error-message">{error}</div>}

      {flights.length > 0 && (
        <div className="flight-results">
          <h3>Available Flights</h3>
          {flights.map((flight, index) => (
            <div key={index} className="flight-card">
              <div className="flight-info">
                <div className="route">
                  <span>{flight.itineraries[0].segments[0].departure.iataCode}</span>
                  <span>→</span>
                  <span>{flight.itineraries[0].segments[0].arrival.iataCode}</span>
                </div>
                <div className="time">
                  <span>{flight.itineraries[0].segments[0].departure.at}</span>
                  <span>-</span>
                  <span>{flight.itineraries[0].segments[0].arrival.at}</span>
                </div>
                <div className="price">
                  {flight.price.currency} {flight.price.total}
                </div>
              </div>
              <button 
                className="book-button"
                onClick={() => window.open(flight.bookingLink, '_blank')}
              >
                Book Now
              </button>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default FlightSearch;
